import React,{Component}from 'react';
import axios from 'axios';
import fileDownload from '../../node_modules/js-file-download'
{/* <button href="https://http://localhost:3000/Request"/> */}
export default class createUser extends Component{
    constructor(props){
        super(props);
        this.handleDownload=this.handleDownload.bind(this);
    }

    handleDownload = (url, filename) => {
        axios.get(url, {
          responseType: 'blob',
        })
        .then((res) => {
          fileDownload(res.data, filename)
        })
      }
       
      

    render(){
        return(
        <div className="container">
          <div className="row">
            <div className="col-md-6 m-auto">
              <form onSubmit={this.onsubmit}>
              <div className="form-group custom-file mb-3">
                    <label className="custom-file-label">{this.state.File}</label>
                    <input type='file' required
                    className="form-control custom-file-input" value={this.state.File}
                    onChange={this.setSelectedFile}/>
                </div>
                <div>
                    <button type="submit" className="btn btn-outline-primary btn-block">Send Request</button>
                </div>
              </form>
            </div>
          </div>
        </div>
        )
    }
}
